El poema es un soneto satírico escrito por Gaspar Núñez de Arce, un poeta español del siglo XIX, conocido por su poesía crítica y de carácter social. El poema hace una burla mordaz a un poeta mediocre, utilizando un lenguaje ingenioso y juegos de palabras.
